import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav style={styles.nav}>
      <h2>Freelancer Finder</h2>

      <div>
        <Link to="/" style={styles.link}>Home</Link>
        <Link to="/freelancers" style={styles.link}>Freelancers</Link>
        <Link to="/jobs" style={styles.link}>Jobs</Link>
        <Link to="/post-job" style={styles.link}>Post Job</Link>
        <Link to="/messages" style={styles.link}>Messages</Link>
        <Link to="/login" style={styles.link}>Login</Link>
      </div>
    </nav>
  );
}

const styles = {
  nav: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "10px 20px",
    background: "#111827",
    color: "white"
  },

  link: {
    margin: "0 12px",
    color: "white",
    textDecoration: "none",
    fontWeight: "bold"
  }
};

export default Navbar;
